import React from 'react';

const Projects = () => {
  return (
    <section id="projects" className="section">
      <h2>Projects</h2>
      <ul>
        <li><strong>Nxt Watch</strong> - <a href="http://ramyakrishnanxt.ccbp.tech" target="_blank" rel="noreferrer">Live Demo</a></li>
        <li><strong>Insta Share</strong> - <a href="http://srkinsta.ccbp.tech" target="_blank" rel="noreferrer">Live Demo</a></li>
        <li><strong>Chatbot UI</strong> - <a href="http://srkchatbot.ccbp.tech" target="_blank" rel="noreferrer">Live Demo</a></li>
        <li><strong>Face Mask Detection</strong> - Face mask recognition using Haar Cascade ML</li>
      </ul>
    </section>
  );
};

export default Projects;
